css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("tlc.com")

{

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, font, strong, p, form, footer, fieldset, section

{
color: white !important;
background: black !important;
}

select, button, .module-videos-all, .module-body-outbrain, .module-videos-carousel, .content-body-gallery, .content-body-columns, .topbar, #region-selector, .module-shows-carousel, .module-right-now, .details, .left-column, .rail-column, .online-exclusives, .module-explore-photos, .promo-wrapper, .promos, .hub-clip-wrapper

{
background: black !important;
}

span

{
background-color: black !important;
}

select, input, span, code, textarea, pre, label, div, dd, option

{
color: white !important;
}


/*links*/

a

{
color: #0040ff !important;
}

a:visited

{
color: #224375 !important;
}

/*highlight*/

textarea, pre, input, code

{
background: #333333 !important;
}

}
